import React from "react";
import smile from "../assets/smile.png";
import pencil from "../assets/pencil.png";
import plus from "../assets/plus.png";
import "../styles/floating.css"; // 버튼 스타일

function FloatingButtons() {
  return (
    <div className="floating-buttons">
      <button className="float-btn yellow"><img src={smile} alt="스티커" /></button>
      <button className="float-btn green"><img src={pencil} alt="생활패턴" /></button>
      <button className="float-btn red"><img src={plus} alt="추가" /></button>
    </div>
  );
}

export default FloatingButtons;
